import React from 'react';
import './styles/card.css'
function Welcome(props){
    return(
        <div className="container">
            <div className="Fitness-User-Info">
                <h1>Hola {props.username}</h1>
                <p>Vamos a con todo</p>
            </div>
        </div>
    )
}
export default Welcome
